Axiom lem4713562 : (forall a : real, ~ (@FINITE real (@GSPEC real (fun GEN_PVAR_200 : real => exists x : real, @SETSPEC real GEN_PVAR_200 (real_lt a x) x)))) /\ ((forall a : real, ~ (@FINITE real (@GSPEC real (fun GEN_PVAR_201 : real => exists x : real, @SETSPEC real GEN_PVAR_201 (real_le a x) x)))) /\ ((forall b : real, ~ (@FINITE real (@GSPEC real (fun GEN_PVAR_202 : real => exists x : real, @SETSPEC real GEN_PVAR_202 (real_lt x b) x)))) /\ ((forall b : real, ~ (@FINITE real (@GSPEC real (fun GEN_PVAR_203 : real => exists x : real, @SETSPEC real GEN_PVAR_203 (real_le x b) x)))) /\ ((forall a : real, forall b : real, (@FINITE real (@GSPEC real (fun GEN_PVAR_204 : real => exists x : real, @SETSPEC real GEN_PVAR_204 ((real_lt a x) /\ (real_lt x b)) x))) = (real_le b a)) /\ ((forall a : real, forall b : real, (@FINITE real (@GSPEC real (fun GEN_PVAR_205 : real => exists x : real, @SETSPEC real GEN_PVAR_205 ((real_le a x) /\ (real_lt x b)) x))) = (real_le b a)) /\ ((forall a : real, forall b : real, (@FINITE real (@GSPEC real (fun GEN_PVAR_206 : real => exists x : real, @SETSPEC real GEN_PVAR_206 ((real_lt a x) /\ (real_le x b)) x))) = (real_le b a)) /\ (forall a : real, forall b : real, (@FINITE real (@GSPEC real (fun GEN_PVAR_207 : real => exists x : real, @SETSPEC real GEN_PVAR_207 ((real_le a x) /\ (real_le x b)) x))) = (real_le b a)))))))).
